import {useState} from 'react';

function App(){
  let todos=["Apple","Banana"];
  return(
    <>
    <ul>
     { todos.map((item,index) => {
        <div>
          <input type='checkbox' />
          <li key={index}>"Learn "+{item}</li>
        </div>
      }) }
    </ul>
    </>
  )
}

export default App;
